import React, {Component} from "react";
import "./music.css";

import { FaVolumeUp, FaVolumeDown} from "react-icons/fa";
import Form from "react-bootstrap/Form";
import {Slider, Handles, Tracks, Rail} from 'react-compound-slider'

let rangeSlider = function(){

};

rangeSlider();

class Music extends Component {
    render() {
        return (
            <div>
                <div className="wrapper">
                    <div className="player">

                        <div id="player-track">
                            <div id="album-name">Album</div>
                            <div id="track-name">Cancion</div>
                            <div id="track-time">
                                <div id="current-time">00</div>
                                <div id="track-length">00</div>
                            </div>
                        </div>
                        <div className="control-panel">
                            <div className="controls">
                                <div className="prev"/>
                                <div  className="play"/>
                                <div className="next"/>
                            </div>
                         </div>
                        <div className="volume">
                            <Form className="range-slider">
                                <Form.Group controlId="formBasicRange">
                                    <Form.Control type="range" className="range-slider__range"/>
                                    <span className="range-slider__value">Volumen</span>
                                </Form.Group>
                            </Form>
                            <Form className="range-slider">
                                <Form.Group controlId="formBasicRange2">
                                    <Form.Control type="range" className="range-slider__range"/>
                                    <span className="range-slider__value">BPS</span>
                                </Form.Group>
                            </Form>
                        </div>
                    </div>
                </div>
            </div>
        )
    }
}


export default Music;
